                ASSERTV(LINE, 0 == decoder.decode(iss, &bob, mO));
                ASSERTV(bob.name(), "Bob" == bob.name());
                ASSERT("Some Street" == bob.homeAddress().street());
                ASSERT("Some City"   == bob.homeAddress().city());
